import React from 'react';
import FormComponent4 from '../components/FormComponent4';

const subjectsData = [
  {
    title: "ENGL 101 Communicative English",
    credits: 2,
    maxIA: 25,
    maxSE: 25,
    marksIA: 20,
    marksSE: 22,
    percentage: "84%",
    grade: "A",
    gradePoint: 8,
    creditPoints: 16,
    result: "Pass",
  },
  {
    title: "ANAT 105 & PHYS 110 Applied Anotomy &Applied Physiology",
    credits: 6,
    maxIA: 25,
    maxSE: 75,
    marksIA: 23,
    marksSE: 70,
    percentage: "93%",
    grade: "A+",
    gradePoint: 9,
    creditPoints: 54,
    result: "Pass",
  },
  {
    title: "SOCI 115 & PHYSC 120 Applied sociology & Applied Psychology",
    credits: 6,
    maxIA: 30,
    maxSE: 75,
    marksIA: 28,
    marksSE: 70,
    percentage: "94%",
    grade: "A+",
    gradePoint: 9,
    creditPoints: 54,
    result: "Pass",
  }
];

const Paragraph6 = () => {
  return (
    <FormComponent4
      title="First Year B.Sc. Nursing Marks Memo"
      subjectsData={subjectsData}
    />
  );
};

export default Paragraph6;
